const Card = (props) => {
  const {
    className,
    children,
    ...rest // spread operator
  } = props;

  return (
    <div className={className} {...rest}>
      {children}
    </div>
  );
};

Card.defaultProps = {
  className: 'Card'
}

export default Card;
